 = function(txt) {\n	if(txt) $(\"#contact-alert\").html(txt).toggle(true);\n}\n\n','contact',1),('Static Web Page','404','Not Found','\n\n.hero-and-content {\n	background-color: #f5f7fa;\n}\nheader, footer {\n	display: none;\n}\nhtml, body {\n	background-color: #f5f7fa;\n}\n.hero-and-content {\n	background-color: #f5f7fa;\n}\n.page-card {\n	max-width: 360px;\n	padding: 15px;\n	margin: 70px auto;\n	border: 1px solid #d1d8dd;\n	border-radius: 4px;\n	background-color: #fff;\n	box-shadow: 0px 3px 6px rgba(0, 0, 0, 0.1);\n}\n.page-card .page-card-head {\n	padding: 10px 15px;\n	margin: -15px;\n	margin-bottom: 15px;\n	border-bottom: 1px solid #d1d8dd;\n}\n.page-card .page-card-head .indicator {\n	color: #36414C;\n	font-size: 14px;\n}\n.page-card .page-card-head .indicator::before {\n	margin: 0 6px 0.5px 0px;\n}\n.page-card .btn {\n	margin-top: 30px;\n}\n.page-card p {\n	font-size: 14px;\n}\n\n\n\nPage Missing or Moved\n\nThe page you are looking for is missing. This could be because it is moved or there is a typo in the link.\nHome\n\nError Code: 404\n\n.hero-and-content {\n	background-color: #f5f7fa;\n}\n\n','404',1),('Static Web Page','about','About Us','\n\nSome Introduction about your company that you would\n			like your website visitor to know.\n			More people than you think will read your About page.\n			People always like to know who the are doing business with.\n			Be authentic and avoid using jargon like \'value added services\' etc.\n			Be sure to update your company history and\n			list of key team members in Website > About Us Settings\n\n','about',1),('Static Web Page','confirm_workflow_action','Confirm Workflow Action','\n\n.hero-and-content {\n	background-color: #f5f7fa;\n}\n.page-card {\n	max-width: 360px;\n	padding: 15px;\n	margin: 70px auto;\n	border: 1px solid #d1d8dd;\n	border-radius: 4px;\n	background-color: #fff;\n	box-shadow: 0px 3px 6px rgba(0, 0, 0, 0.1);\n}\n.page-card .page-card-head {\n	padding: 10px 15px;\n	margin: -15px;\n	margin-bottom: 15px;